import React from "react";
import { Marker } from "@react-google-maps/api";

const MapCentering = ({ center }) => {
  return (
    <Marker position={center} icon={{ url: "http://maps.google.com/mapfiles/ms/icons/blue-dot.png" }} />
  );
};

export default MapCentering;
